import Navbar from './components/Navbar'
import Body from './components/Body'
import Welcome from './components/Welcome'
const App=()=>{
const [windowCng,setWindow]=useState(false)
return(
<>
<Navbar/>
{
windowCng==true?
<Body/>
:<Welcome/>
}
</>
)
}
export default App;
